import TradeItem from './components/TradeItem';

function App() {
    const trades = [
      {
        date: new Date(2020, 7, 14),
        ticker: 'E1',
        name: 'Toilet',
        amount: 94.12,
      },
      { date: new Date(2021, 2, 12), ticker: 'e2', name: 'New TV', amount: 799.49 },
      {
        date: new Date(2021, 2, 28),
        ticker: 'E3',
        name: 'Car',
        amount: 294.67,
      },
      {
        date: new Date(2021, 5, 12),
        ticker: 'E34',
        name: 'New',
        amount: 450,
      },
    ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <TradeItem></TradeItem>
      <TradeItem></TradeItem>
    </div>
  );
}

export default App;
